function ajaxGetEvents(){return $.ajax({type:"GET",url:loc+"/js/tips.json",contentType:"application/json",processData:!1}).done(function(){App.loading=!1})}var loc=window.location.href;$(document).ready(function(){var e=new Vue({el:"#Tips",data:{json:[]},created:function(){ajaxGetEvents().done(function(n){e.json=n}).fail(function(e){console.log(e)})}})});